import React from 'react';
import { MdBeachAccess } from 'react-icons/md';
import { Button } from 'react-bootstrap';
import './VacationButton.css'


const VacationButton = () => {

  return (
    <>
      <div className="pb-2 d-flex align-items-center justify-content-center">
        <div className="btn-wrap">
          <button className="px-3 pt-2 pb-2 btn-disabled">
            <div className="btn-point">
              <span className="btn-icon-name">
                휴가 신청 내역
              </span>
            </div>
          </button>
        </div>
        <div className="btn-wrap">
          <button className="px-3 pt-2 pb-2 btn-active">
            <div className="btn-point">
              <span className="btn-icons"><MdBeachAccess /></span>
              <span className="btn-icon-name">휴가사용</span>
            </div>
          </button>
        </div>
        {/* <Button variant="outline-secondary" className="me-3">휴가 신청 내역</Button> */}
        {/* <Button variant="primary">휴가사용</Button> */}
      </div>
    </>
  )
}

export default VacationButton;
